import './App.css';
//import TeloStranky from './eKnižka';
import Katalog from './Katalog.js';
import horna_lista from'./hornalista.js';

function App() {
  return (
    <>
      <horna_lista />
      <body>
        <Katalog />
      </body>
      <footer className="footer">
        <p>Webové technológie 2022</p>
      </footer>
      <script src="java/main.js"></script>
    </>
  );
}

export default App;
